import { getTimeDate } from "@/utils/index.js";
import Qs from "qs"; // 1，未完善资料，2、已提交资料，待平台审核，3、审核中，4、审核通过，5、审核失败，6、正常，7、锁定，8，黑名单

export default {
  filters: {
    statusFilter: function statusFilter(status) {
      var statusMap = {
        1: "info",
        2: "primary",
        3: "success",
        4: "danger"
      };
      return statusMap[status];
    }
  },
  data: function data() {
    return {
      fileurl: "",
      list: null,
      multipleSelection: [],
      listLoading: true,
      exporting: false,
      form: {
        status: "",
        userId: "",
        starttime: "",
        endtime: "",
        _uiName_: "eleme",
        _pagination: "{'pageNumber':1,'pageSize':10}"
      }
    };
  },
  created: function created() {},
  computed: {},
  mounted: function mounted() {
    this.fetchData();
  },
  methods: {
    formatTime: function formatTime(row, column, cellValue) {
      return getTimeDate(cellValue);
    },
    getStatusname: function getStatusname(statusid) {
      var statusMap = {
        1: "待转账",
        2: "转账中",
        3: "转账成功",
        4: "转账失败"
      };
      return statusMap[statusid];
    },
    resetForm: function resetForm(formName) {
      this.$refs[formName].resetFields();
    },
    //获取充值申请列表
    fetchData: function fetchData() {
      var _this = this;

      this.listLoading = true;
      this.axios.get(this.urls.cashoutlist + "?" + Qs.stringify(this.form)).then(function (response) {
        _this.list = response.data.list;
        _this.listLoading = false;
      });
    },
    operationHandle: function operationHandle(index, row, type) {
      // let ids = "";
      // this.multipleSelection.forEach(row => {
      //   ids = ids + row.id + ",";
      // });
      var param = {
        ids: row.id
      };

      switch (type) {
        case 1:
          this.operationRemote(this.urls.cashoutsuccess, param); // 提现成功

          break;

        case 0:
          this.operationRemote(this.urls.cashoutfail, param); // 提现失败

          break;

        default:
          break;
      }
    },
    operationRemote: function operationRemote(url, param) {
      var _this2 = this;

      this.$confirm("是否确认操作?", "提示", {
        confirmButtonText: "确定",
        cancelButtonText: "取消",
        type: "warning"
      }).then(function () {
        _this2.axios.post(url + "?" + Qs.stringify(param)).then(function (response) {
          _this2.fetchData();
        });
      });
    },
    toggleSelection: function toggleSelection(rows) {
      var _this3 = this;

      if (rows) {
        rows.forEach(function (row) {
          _this3.$refs.multipleTable.toggleRowSelection(row);
        });
      } else {
        this.$refs.multipleTable.clearSelection();
      }
    },
    handleSelectionChange: function handleSelectionChange(val) {
      this.multipleSelection = val;
    },
    lookinfo: function lookinfo() {},
    exportTxt: function exportTxt() {
      var _this4 = this;

      if (this.multipleSelection.length == 0) return this.$message.error("请选择需要导出的数据");
      this.exporting = true;
      var ids = "";
      this.multipleSelection.forEach(function (row) {
        ids = ids + row.id + ",";
      });
      this.axios.post(this.urls.cashoutexport + "?" + Qs.stringify({
        ids: ids
      })).then(function (response) {
        _this4.fetchData();

        _this4.fileurl = _this4.urls.imgbaseurl + response.data.substring(2, response.data.length);
        _this4.exporting = false;

        _this4.axios.get(_this4.fileurl).then(function (response) {
          var blob = new Blob([response.data], {
            type: "application/txt"
          });
          var fileName = "谦恒提现申请表" + "-" + getTimeDate(Date.parse(new Date())) + ".txt";

          if (window.navigator.msSaveOrOpenBlob) {
            navigator.msSaveBlob(blob, fileName);
          } else {
            var link = document.createElement("a");
            link.href = window.URL.createObjectURL(blob);
            link.download = fileName;
            link.click();
            window.URL.revokeObjectURL(link.href);
          }
        });
      });
    }
  }
};
